export default function Lista(electronica, alimentacion, mascotas) {
  return (
    <div>
      {electronica.map((producto) => (
        <p>
          {" "}
          {producto.producto} - {producto.marca} - {producto.modelo} -{" "}
          {producto.precio}{" "}
        </p>
      ))}
      {alimentacion.map((producto) => (
        <p>
          {" "}
          {producto.producto} - {producto.marca} - {producto.modelo} -{" "}
          {producto.precio}{" "}
        </p>
      ))}
      {mascotas.map((producto) => (
        <p>
          {" "}
          {producto.producto} - {producto.marca} - {producto.modelo} -{" "}
          {producto.precio}{" "}
        </p>
      ))}
    </div>
  );
}
